import axios from "axios"
const SERVER = 'http://127.0.0.1:8000'
const headers = {
  'Content-Type': 'application/json',
  'Authorization': 'JWT fefege..'
}

const worldMap = x => axios.get(`${SERVER}/api/map/world-maps`)
const medPointMap = x => axios.get(`${SERVER}/users/exist/${x}`)
const casesMap = x => axios.get(`${SERVER}/users/${x.userId}`)

export default {
  worldMap,
  medPointMap,
  casesMap,
}
